import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import "../css/chatting.css";
import { ChatBTN, HelpBTN } from "./Buttons";

export function Chatting() {
  return (
    <div>
      <Header />
      <div className="main-container-chat">
        <div className="chat-box">
          <div className="messages">
            <div className="message user">안녕하세요!</div>
            <div className="message bot">안녕하세요! 어떻게 도와드릴까요?</div>
            <div className="message user">저는 채팅 테스트 중이에요.</div>
            <div className="message bot">알겠습니다. 테스트에 도움이 필요하신가요?</div>
          </div>
          <div className="input-container">
            <input
              type="text"
              placeholder="메시지를 입력하세요..."
              className="chat-input"
            />
            <button className="send-button">전송</button>
          </div>
        </div>
      </div>
      <ChatBTN />
      <HelpBTN />
      <Footer />
    </div>
  );
}
